import React from 'react'
import styled from '@emotion/styled';
import { Link } from "react-router-dom";

const StyledMain = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
`;

const Home = () => {
    return (
        <StyledMain>
            <div>
                <Link to='/graph'>
                    Import
                </Link></div>
            <div>Paste</div>
            <div>Manual</div>
        </StyledMain>
    )
}

export default Home;
